// SPDX-License-Identifier: MIT
pragma solidity >=0.4.21 <0.9.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import { Lib, IterableMapping } from "./Lib.sol";

contract IBet is ERC20("Crypto Bet","IBET"), Ownable, Pausable, ReentrancyGuard {
      using SafeMath for uint256;

      using IterableMapping for IterableMapping.Map;

address constant private ESCROW_ACCOUNT_ADDRESS = 0x4ADaFa1738F7e60Db3c0415Eb790eAf70010E291;

mapping(bytes32 => Lib.Bet) private bets;
mapping(bytes32 => Lib.BetProperties) private betProperties;

mapping(address => bytes32[]) private betsByAddress;

mapping(address => bool) private authorizedCallers;

mapping(uint16 => IterableMapping.Map) private pendingArbitrationQueue;

mapping(bytes32 => Lib.ArbitrationState) private publicArbitrations;

mapping(bytes32 => Lib.SubmittedOutComeProperties) private submittedOutComeProperties;

IterableMapping.Map private openBetsQueue;

uint256 private MAX_SHARING_BONUS = 3328599575200 * 1000000000000000000;
uint256 private SHARING_BONUS_DISBURSED = 0;
mapping(address => Lib.SharingBonusReceipt[]) private SharingBonusMap;
mapping(address => bool) private SharingBonusReceiverMap;
uint256 private SHARING_BONUS_DISBURSED_COUNT = 0;

uint256 private MAX_SERVICE_TOKENS = 1000000000000 * 1000000000000000000;
uint256 private SERVICE_TOKENS_DISBURSED = 0;
uint256 constant private GENESIS_TOKEN = 1;

uint256 private MAX_SUPPLY = MAX_SHARING_BONUS + MAX_SERVICE_TOKENS + GENESIS_TOKEN;

// This will be used to determine the arbitratorCommissionPercent, it will exponentially lesson until the maxsupply is reached. once max supply is exhausted, betters will need to pay 0.35% commission
uint256 private TOTAL_BET_SO_FAR = 0;
uint256 private TOTAL_BET_COUNT_SO_FAR = 0;
uint16 private ARBITRATION_COMPLEXITY_INDEX = 0;

constructor() {
    _mint(msg.sender, 1 * 1000000000000000000);
}

modifier IsAuthorizedCaller()
{
   require(authorizedCallers[msg.sender] == true, "Caller is not authorized");
    _;
}

function authorizeCaller(address _address) public onlyOwner {
   authorizedCallers[_address] = true;
}

function deAuthorizeCaller(address _address) private onlyOwner {
   authorizedCallers[_address] = false;
}

function saveBet(Lib.Bet memory bet)
public IsAuthorizedCaller returns (bool){
   bets[bet.betKey] = bet;
   return true;
}

function getServiceTokensDisbursedCount() public IsAuthorizedCaller view returns (uint256){
   return SERVICE_TOKENS_DISBURSED;
}

function getMaxServiceTokensCount() public IsAuthorizedCaller view returns (uint256){
   return MAX_SERVICE_TOKENS;
}

function safeAddBetsToAddress(address addr, bytes32 betKey) public IsAuthorizedCaller {

      bool containsBet = false;
      for(uint256 index = 0; index < betsByAddress[addr].length; index++)
      {
         if(betsByAddress[addr][index] == betKey)
         {
            containsBet = true;
         }
      }
      if(containsBet == false)
      {
         betsByAddress[addr].push(betKey);
      }
}

function getBet(bytes32 betKey) public IsAuthorizedCaller view  returns (Lib.Bet memory bet)
{
   return bets[betKey];
}

function saveBetProperty(bytes32 betKey, string memory key, string memory value)
public IsAuthorizedCaller returns (bool){
   betProperties[betKey].properties[key] = value;
   return true;
}

function getBetProperty(bytes32 betKey, string memory key)
public IsAuthorizedCaller view returns (string memory){
   return betProperties[betKey].properties[key];
}

function reward(address rewardAddress, uint256 amount) public IsAuthorizedCaller returns (bool){
     _mint(rewardAddress, amount);
     return true;
}

function burn(address fromAddress, uint256 amount) public IsAuthorizedCaller returns (bool){
     _burn(fromAddress, amount);
     return true;
}

function transferToEscrow(address fromAddress, uint256 amount) public IsAuthorizedCaller returns (bool){
     require(fromAddress != address(0), "Cannot transfer from invalid address");
     _transfer(fromAddress, ESCROW_ACCOUNT_ADDRESS, amount);
     return true;
}

function transferFromEscrow(address toAddress, uint256 amount) public IsAuthorizedCaller returns (bool){
   require(toAddress != address(0), "Cannot transfer to invalid address");
      _transfer(ESCROW_ACCOUNT_ADDRESS, toAddress, amount);
     return true;
}

function getMyBetKeys(address addr) public IsAuthorizedCaller view returns (bytes32[] memory){
     return betsByAddress[addr];
}

function getOpenBetsCount() public IsAuthorizedCaller view returns (uint){
   return openBetsQueue.size();
}

function getOpenBetAtIndex(uint256 index) public IsAuthorizedCaller view returns (bytes32 betKey){
   return openBetsQueue.getKeyAtIndex(index);
}

function removeOpenBetByValue(bytes32 betKey) public IsAuthorizedCaller{
   return openBetsQueue.remove(betKey);
}

function addOpenBetByValue(bytes32 betKey, uint256 val) public IsAuthorizedCaller{
   return openBetsQueue.set(betKey, val);
}

function getPendingArbitrationCount(uint16 complexityIndex) public IsAuthorizedCaller view returns (uint){
   return pendingArbitrationQueue[complexityIndex].size();
}

function getPendingArbitrationAtIndex(uint16 complexityIndex, uint256 index) public IsAuthorizedCaller view returns (bytes32){
   return pendingArbitrationQueue[complexityIndex].getKeyAtIndex(index);
}

function removePendingArbitrationByValue(uint16 complexityIndex, bytes32 betKey) public IsAuthorizedCaller{
   return pendingArbitrationQueue[complexityIndex].remove(betKey);
}

function addPendingArbitrationByValue(uint16 complexityIndex, bytes32 betKey, uint256 val) public IsAuthorizedCaller{
   return pendingArbitrationQueue[complexityIndex].set(betKey, val);
}

function getSubmittedOutComes(bytes32 betKey) public IsAuthorizedCaller view returns (Lib.SubmittedOutCome[] memory){
   return publicArbitrations[betKey].submittedOutComes;
}

function getSubmittedOutComesCount(bytes32 betKey) public IsAuthorizedCaller view returns (uint256){
   return publicArbitrations[betKey].submittedOutComes.length;
}

function addSubmittedOutcome(bytes32 betKey, Lib.SubmittedOutCome memory outcome) public IsAuthorizedCaller {
   publicArbitrations[betKey].submittedOutComes.push(outcome);
}

function getTotalBetSoFar() public IsAuthorizedCaller view returns (uint256){
   return TOTAL_BET_SO_FAR;
}

function updateTotalBetSoFar(uint256 totalBetSoFar) public IsAuthorizedCaller {
   TOTAL_BET_SO_FAR = totalBetSoFar;
}

function getArbitrationComplexityIndex() public IsAuthorizedCaller view returns (uint16){
   return ARBITRATION_COMPLEXITY_INDEX;
}

function updateArbitrationComplexityIndex(uint16 complexityIndex) public IsAuthorizedCaller {
   ARBITRATION_COMPLEXITY_INDEX = complexityIndex;
}

function incrementTotalBetCountSoFar() public IsAuthorizedCaller {
   TOTAL_BET_COUNT_SO_FAR++;
}

function isOutcomeSubmittedBySubmitter(bytes32 betKey, address submitter) public IsAuthorizedCaller view returns (bool){
   return publicArbitrations[betKey].submissions[submitter];
}

function markSubmitterOutcomeSubmitted(bytes32 betKey, address submitter) public IsAuthorizedCaller {
   publicArbitrations[betKey].submissions[submitter] = true;
}

function saveSubmittedOutComeProperty(bytes32 submittedOutcomeKey, string memory key, string memory value)
public IsAuthorizedCaller returns (bool){
   submittedOutComeProperties[submittedOutcomeKey].properties[key] = value;
   return true;
}

function getSubmittedOutComeProperty(bytes32 submittedOutcomeKey, string memory key)
public IsAuthorizedCaller view returns (string memory){
   return submittedOutComeProperties[submittedOutcomeKey].properties[key];
}

function transfer(address recipient, uint256 amount) public override returns (bool) {
  
   if(SHARING_BONUS_DISBURSED < MAX_SHARING_BONUS && amount>0 && SharingBonusReceiverMap[recipient] != true)
   {
      if(SharingBonusMap[_msgSender()].length>0)
      {
         uint256 timesSharedInLast7Days = 0;
         uint8 i = 0;
         while (i < SharingBonusMap[_msgSender()].length) { // while loop
             if(block.timestamp.sub(SharingBonusMap[_msgSender()][i].timestamp)> 7 days){
               SharingBonusMap[_msgSender()][i] = SharingBonusMap[_msgSender()][SharingBonusMap[_msgSender()].length-1];
               SharingBonusMap[_msgSender()].pop();
               i--;
            } else {
               timesSharedInLast7Days++;
            }
           i++;
         }
         if(timesSharedInLast7Days<4){
            rewardSharingBonus(_msgSender(), recipient);
         }
      } else
      {
        rewardSharingBonus(_msgSender(), recipient);
      }
   }

   _transfer(_msgSender(), recipient, amount);
   return true;
}

function rewardSharingBonus(address sender, address recipient) private {
   // only every 7 days
   uint256 rewardBonus = calculateSharingBonus(SHARING_BONUS_DISBURSED_COUNT);
   SHARING_BONUS_DISBURSED = SHARING_BONUS_DISBURSED.add(rewardBonus);
   SharingBonusMap[sender].push(Lib.SharingBonusReceipt(recipient, block.timestamp));
   SharingBonusReceiverMap[recipient] = true;
   SHARING_BONUS_DISBURSED_COUNT = SHARING_BONUS_DISBURSED_COUNT + 1;
   _mint(sender, rewardBonus);
}



function calculateSharingBonus(uint256 disbursedCount) internal pure returns (uint256){

      //y =((-39600) * (log(base2)x))) + 1000000
      if(disbursedCount < 2) return Lib.ibetTokenWithFullDecimals(1000000);
      if(disbursedCount < 4) return Lib.ibetTokenWithFullDecimals(960400);
